import React, { Component } from "react";
import { HashRouter as Router, Route, Link, NavLink } from "react-router-dom";
import SignUpForm from "./pages/SignUpForm";
import SignInForm from "./pages/SignInForm";
import Modal from 'react-bootstrap/Modal';
import { Form, Button, FormGroup, FormControl, ControlLabel, Col, Nav, Navbar} from "react-bootstrap";
import Popup from "reactjs-popup";

export default class HomeComponent extends Component {
  render() {
    return (
      <div className="HomeComponent">
        <Router>
            <Example/>
            {/*<Switch>
                            <Route path="/" exact component={FooterComponent}/>
                            <Route path="/SignUpForm" component={SignUpComponent}/>
                            <Route path="/welcome/:name" component={WelcomeComponent}/>
                            <Route path="/logout" component={LogoutComponent}/>
                            <Route path="/SignInForm" component={SignInForm.SignInComponent}/>
                            <Route component={ErrorComponent}/>
                        </Switch>*/}
            <FooterComponent />
        </Router>
      </div>
    );
  }
}


function Example() {
  const [show, setShow] = useState(false);

  const handleClose = () => setShow(false);
  const handleShow = () => setShow(true);

  return (
    <>
      <Button variant="primary" onClick={handleShow}>
        Launch demo modal
      </Button>

      <Modal show={show} onHide={handleClose}>
        <Modal.Header closeButton>
          <Modal.Title>Modal heading</Modal.Title>
        </Modal.Header>
        <Modal.Body>Woohoo, you're reading this text in a modal!</Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={handleClose}>
            Close
          </Button>
          <Button variant="primary" onClick={handleClose}>
            Save Changes
          </Button>
        </Modal.Footer>
      </Modal>
    </>
  );
}

